package com.example.prescription_module.bootstrap;import com.example.prescription_module.domain.Medication;import com.example.prescription_module.domain.PrescriptionHistory;import com.example.prescription_module.repositories.PrescriptionHistoryRepository;import com.example.prescription_module.services.PrescriptionHistoryService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.boot.CommandLineRunner;import org.springframework.stereotype.Component;import java.sql.Timestamp;import java.util.HashSet;import java.util.Set;@Componentpublic class DataLoader implements CommandLineRunner {    @Autowired    private PrescriptionHistoryService prescriptionHistoryService;    @Autowired    private PrescriptionHistoryRepository prescriptionHistoryRepository;    @Override    public void run(String... args) throws Exception {        loadPrescriptionHistories();    }    public void loadPrescriptionHistories() {        Set<Medication> medications1 = new HashSet<>();        medications1.add(new Medication("Aspirin"));        PrescriptionHistory history1 = new PrescriptionHistory(1L, 1L, new Timestamp(System.currentTimeMillis()), medications1);        prescriptionHistoryRepository.save(history1);        Set<Medication> medications2 = new HashSet<>();        medications2.add(new Medication("Ibuprofen"));        PrescriptionHistory history2 = new PrescriptionHistory(2L, 2L, new Timestamp(System.currentTimeMillis()), medications2);        prescriptionHistoryRepository.save(history2);    }}